function next_overlay_shadows(){document.querySelectorAll('.nb-overlay-shadows').forEach(overlayShadow=>{var shadow=overlayShadow.querySelector(".nb-overlay-shadows__mask");function setMask(src){shadow.style.maskImage=`url('${src}')`;shadow.style.webkitMaskImage=`url('${src}')`}
var src=overlayShadow.getAttribute("data-src");setMask(src);overlayShadow.removeAttribute("data-flickering")})}
document.addEventListener("DOMContentLoaded",function(t){bricksIsFrontend&&next_overlay_shadows()})